INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", 10.11, 109001, 0, 24003, 10011, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 2, 24, 8.0, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 3, -385.0, 1);
