INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", 6.0, 109001, 0, 24005, 10011, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 2, 24, 8.0, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 5, -385.0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", 0.0, 109002, 0, 24006, 10011, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 1, 24, 0.0, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 6, 0.0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", 0.0, 109002, 0, 24007, 10011, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 1, 24, 0.0, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 7, 0.0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", 0.0, 109002, 0, 24008, 10011, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 1, 24, 0.0, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 8, 0.0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", 0.0, 109002, 0, 24009, 10011, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 1, 24, 0.0, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 9, 0.0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", 0.0, 109002, 0, 24010, 10011, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 1, 24, 0.0, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 10, 0.0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", 2.12, 109101, 0, 24011, 10011, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 2, 24, 8.0, "2019/01/31 12:00:00", "シズル（バレンタイン）", 1, -385.0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", 4.19, 109101, 0, 24012, 10011, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 2, 24, 8.0, "2019/01/31 12:00:00", "シズル（バレンタイン）", 2, -385.0, 5);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", 2.3, 109101, 0, 24013, 10011, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 4, 24, 8.0, "2019/01/31 12:00:00", "シズル（バレンタイン）", 3, -385.0, 2);
